import React from 'react';
import Slide from './Slide';

const MainContent = () => {
  return (
    <main>
      <Slide id="publications" title="Publications">
        {/* Publications content goes here */}
      </Slide>
      <Slide id="data" title="Data">
        {/* Data content goes here */}
      </Slide>
      <Slide id="codebase" title="Codebase">
        {/* Codebase content goes here */}
      </Slide>
      <Slide id="experimental-setups" title="Experimental Setups">
        {/* Experimental setups content goes here */}
      </Slide>
    </main>
  );
};

export default MainContent;
